import styles from './myPage.module.scss'
import { Link, useNavigate } from 'react-router-dom'
import store from 'store'
import { MouseEvent } from 'react'
import Breadcrumb from 'components/Breadcrumb'
import cx from 'classnames'

const MyPage = () => {
  const navigate = useNavigate()
  const ratingData = store.get('ratingStore')
  const readingData = store.get('readingStore')
  const likeData = store.get('likeStore')

  const handleEventClick = (e: MouseEvent<HTMLButtonElement>) => {
    const { page } = e.currentTarget.dataset
    navigate(`${page}`)
  }

  const pageList = [['마이페이지', '../mypage']]

  return (
    <div className={styles.myPage}>
      <Breadcrumb pageList={pageList} />
      <div className={styles.buttonWrapper}>
        <Link to='bookrating' className={cx(styles.button, styles.rating)}>
          평가 {ratingData.length}
        </Link>

        <button
          type='button'
          className={cx(styles.button, styles.rating)}
          data-page='bookrating'
          onClick={handleEventClick}
        >
          평가 {ratingData.length}
        </button>
        <button
          type='button'
          className={cx(styles.button, styles.like)}
          data-page='bookwant'
          onClick={handleEventClick}
        >
          읽고싶어요 {likeData.length}
        </button>
        <button
          type='button'
          className={cx(styles.button, styles.reading)}
          data-page='bookreading'
          onClick={handleEventClick}
        >
          읽고있어요 {readingData.length}
        </button>
      </div>
    </div>
  )
}

export default MyPage
